Up the Yangtze

Travel Documentary hosted by Yung Chang, published by NFB in 2007 - English narration


Information
------------------------------

A luxury cruise boat motors up the Yangtze - navigating the mythic waterway known in China simply as &quot;The River.&quot; The Yangtze is about to be transformed by the biggest hydroelectric dam in history. At the river's edge - a young woman says goodbye to her family as the floodwaters rise towards their small homestead. The Three Gorges Dam - contested symbol of the Chinese economic miracle - provides the epic backdrop for Up the Yangtze, a dramatic feature documentary on life inside modern China.
Produced by EyeSteel Productions in co-production with the National Film Board of Canada.

